webpackJsonp([0xe3bb4585a21d],{318:function(A,a){A.exports={data:{markdownRemark:{html:'<p>As I always do, to arrive at time I stay awake the whole night, so I spent that night coding &#x26; designing like most of my days.\nSo after <a href="/getting-my-first-job-offer">I declined the job offer</a>, I was invited once again to participate in a great hackathon organized by <a href="https://lematin.ma">Lematin</a> by partnering with Screendy, but this hackathon was a bit serious since they invited only ideas holders at the beginning to select the good ones, then they invited us : designers, developers &#x26; marketers to help them make a prototype.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Co-working space"\n        title=""\n        src="/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-5025c.jpeg"\n        srcset="/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-097a5.jpeg 270w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-d02ea.jpeg 540w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-5025c.jpeg 1080w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-66465.jpeg 1620w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-7862b.jpeg 2160w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-711c0.jpeg 3240w,\n/static/coworking_space-257d514dd965b010b9aa2f02b88a643a-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The event took place in <a href="https://smartcenter.ma/">Smart Center</a>, a great co-working place which I recommend you to visit if someday you visited Casablanca city, Morocco.</p>\n<p>Anyway as every other hackathon, the CEO of Lematin introduced &#x26; declared the start of the hackathon, ideas holders started pitching their ideas so that we choose the one idea we got interested in, so once I heard the COOP 360 idea from a great guy, I immediately asked him to join the team as a designer &#x26; developer as the same time &#x26; he accepted instantly after showing him off my works.</p>\n<p>Since it was an E-commerce platform I had to use my own github repo — <a href="https://github.com/smakosh/Smartshop">https://github.com/smakosh/Smartshop</a> — of a starter kit E-commerce app built with php/mysql — yeah it lacks many things but it does the work as a prototype — anyway I started designing the logo, illustrations, changing sass color variables &#x26; adding more pages since we needed more features because it wasn’t only an online shop, I didn’t sleep since I was focused on finishing that prototype, after 36 hours non stop of work, the jury then came in and projects’ holders started pitching their ideas with a demo of the prototype.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jury-343f8701057dc4a23ec6a077d41e2ac6-5025c.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Pitch time"\n        title="the guy with the glasses and suit looks just like Iron Man"\n        src="/static/jury-343f8701057dc4a23ec6a077d41e2ac6-5025c.jpeg"\n        srcset="/static/jury-343f8701057dc4a23ec6a077d41e2ac6-097a5.jpeg 270w,\n/static/jury-343f8701057dc4a23ec6a077d41e2ac6-d02ea.jpeg 540w,\n/static/jury-343f8701057dc4a23ec6a077d41e2ac6-5025c.jpeg 1080w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>To be honest I didn’t believe that we were going to win as I told my friend that we wouldn’t win this when the Jury was about to announce the winners of the first prize, but yeah I was wrong, we actually won &#x26; got invited to assist to a conference where we’ll receive our prizes.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="getting the first prize"\n        title=""\n        src="/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-5025c.jpeg"\n        srcset="/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-097a5.jpeg 270w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-d02ea.jpeg 540w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-5025c.jpeg 1080w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-66465.jpeg 1620w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-7862b.jpeg 2160w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-711c0.jpeg 3240w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/trophy-7d0e6802785d403d8152d083dd7772fd-e70b7.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 125%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="the trophy"\n        title=""\n        src="/static/trophy-7d0e6802785d403d8152d083dd7772fd-5025c.jpeg"\n        srcset="/static/trophy-7d0e6802785d403d8152d083dd7772fd-097a5.jpeg 270w,\n/static/trophy-7d0e6802785d403d8152d083dd7772fd-d02ea.jpeg 540w,\n/static/trophy-7d0e6802785d403d8152d083dd7772fd-5025c.jpeg 1080w,\n/static/trophy-7d0e6802785d403d8152d083dd7772fd-66465.jpeg 1620w,\n/static/trophy-7d0e6802785d403d8152d083dd7772fd-7862b.jpeg 2160w,\n/static/trophy-7d0e6802785d403d8152d083dd7772fd-e70b7.jpeg 3024w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><a href="https://lematin.ma/express/2017/remise-des-trophees-aux-gagnants-du-hackathon-laquo-morocco-social-tech-raquo-/274777.html">News coverage</a></p>\n<p>As a conclusion, what I really learned during this hackathon is to never give up and just do your best &#x26; go beyond your obstacles!!</p>',timeToRead:2,frontmatter:{date:"July 08, 2017",edited:null,path:"/first-time-first-prize",title:"First time getting first prize at a hackathon",next:"/getting-my-first-job-offer",id:5,thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-f2ac0.jpeg",srcSet:"/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-567e3.jpeg 158w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-c3206.jpeg 315w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-f2ac0.jpeg 630w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-0c4a5.jpeg 945w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-211f3.jpeg 1260w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-0150a.jpeg 1890w,\n/static/winners-7f3e46c6aac37fb08ebb72a7b290ae80-16bdb.jpeg 4032w",sizes:"(max-width: 630px) 100vw, 630px"}}}}}},pathContext:{}}}});
